INSERT INTO mol_error_list(code,name,message,description,seriousness1,seriousness2,optional_solution) VALUES ('10010','DTC_NO_INPUT_VOLT','Töltő probléma','Alacsony hálózati feszültség',NULL,NULL,'1) ellenőrizze a bemeneti feszültséget az X1 kapcsokon, töltse ki az alábbi táblázatot (várhatóan 400 V és 250 V) 2) ha az értékek nem megfelelőek, ellenőrizze a hálózati bemeneti feszültséget 3) ha rendben van a hálózattal, ellenőrizze az RFI szűrőt A1 (bemeneti és kimeneti feszültség 400V legyen)');
INSERT INTO mol_error_list(code,name,message,description,seriousness1,seriousness2,optional_solution) VALUES ('10011','DTC_TILT_FAULT','Töltő probléma','Tilt hiba aktiválva','Töltő probléma',NULL,'1) ellenőrizze a töltő állapotát, ha valami megrongálta (pl. elektromos autó)');
INSERT INTO mol_error_list(code,name,message,description,seriousness1,seriousness2,optional_solution) VALUES ('10014','DTC_OVER_CURR_HW','Töltő probléma','Túláram a hardver kimenetén',NULL,NULL,'e-mailben Nuno');
INSERT INTO mol_error_list(code,name,message,description,seriousness1,seriousness2,optional_solution) VALUES ('15000','DTC_K1_FAULT','Töltő probléma','A bemeneti kontaktor meghibásodott','Beviteli hiba',NULL,'1) ellenőrizze, hogy a töltőajtó megfelelően zárva van-e 2) ellenőrizze az x17.1 (230V) kivezetéseket az A5-ös kártyán');
INSERT INTO mol_error_list(code,name,message,description,seriousness1,seriousness2,optional_solution) VALUES ('15001','DTC_Q1_FAULT','Töltő probléma','hálózati megszakító kinyílt','Beviteli hiba',NULL,'1) ellenőrizze, hogy a Q1 zárva van-e, és megfelelően van-e csatlakoztatva a megszakítóhoz 2) ellenőrizze a folytonosságot az x8.1 és x8.2 csatlakozón, 0 ohmnak kell lennie 3) ha nem 0 ohm, akkor a probléma a segédkontaktor lehet - Q1, ki kell cserélni 4) ha 0 ohm, próbálja meg cserélni az A5-ös kártyát');
INSERT INTO mol_error_list(code,name,message,description,seriousness1,seriousness2,optional_solution) VALUES ('15002','DTC_FUSES_BLOWN','Töltő probléma','Biztosítékok kiégtek','Beviteli hiba',NULL,'1) ellenőrizze multiméterrel az összes biztosíték folytonosságát, 0 ohmnak kell lennie 2) ellenőrizze a biztosítéktartó kapcsolóját, ehhez vegye le az A5-ös kártyáról az x12.1 és x12.2 csatlakozót és ellenőrizze a folytonosságot, 0 ohmnak kell lennie 3) ha nem 0 ohm, akkor a kapcsolóval lehet probléma, próbáld meg cserélni 4) ha 0 ohm, akkor az A5-ös lappal lehet gondunk, próbáld meg cserélni 5) cseréld ki a kiégett biztosítékokat');
INSERT INTO mol_error_list(code,name,message,description,seriousness1,seriousness2,optional_solution) VALUES ('15003','DTC_Q2_FAULT','Töltő probléma','kisegítő megszakító kinyílt','Beviteli hiba',NULL,'1) ellenőrizze, hogy a Q2 zárva van-e 2) az A5-ös kártyán, ellenőrizze a folytonosságot az x13.1 és x13.2 csatlakozón, 0 ohmnak kell lennie 3) ha nem 0 ohm, akkor a probléma a Q2 segédérintkezővel lehet. cserélve 4) ha 0 ohm, próbálja meg cserélni az A5-ös kártyát');
INSERT INTO mol_error_list(code,name,message,description,seriousness1,seriousness2,optional_solution) VALUES ('15004','DTC_K2_PROB','Töltő probléma','Inrush áram kontaktor probléma','Beviteli hiba',NULL,'1) az A5-ös kártyán ellenőrizze a folytonosságot az X7.1-en és az X7.2-n, 0 ohmnak kell lennie a k2 zárásának pillanatában 2)');
INSERT INTO mol_error_list(code,name,message,description,seriousness1,seriousness2,optional_solution) VALUES ('20001','DTC_ISULAT_FAIL','Gépjármű probléma','Az autó kontaktorainak szigetelési hibája','Járműprobléma',NULL,'1) próbálja meg tölteni egy másik autóval 2) próbálja meg kicserélni az A9-es kártyát 3) próbálja meg kicserélni az A8-as kártyát');
